    <canvas id="dotCanvas" width="540" height="380"></canvas>

    <script>
      const canvas = document.getElementById('dotCanvas');
      const ctx = canvas.getContext('2d');
    
      function convertDotsToCanvas() {
        const dots = document.querySelectorAll('.dot-base i'); // 기존 dot 데이터 가져오기
    
        dots.forEach(dot => {
          // `left`, `top`, `background` 속성값 추출
          let x = parseInt(dot.style.left, 10);
          let y = parseInt(dot.style.top, 10);
          let color = dot.style.background;
    
          // 캔버스에 픽셀 그리기
          ctx.fillStyle = color;
          ctx.fillRect(x, y, 4, 4); // 1x1 크기의 점 찍기
        });
    
        // 기존 dot 태그 제거
        document.querySelector('.portfolio').remove();

        console.log("모든 dot을 Canvas로 변환 완료!");
      }
    
      // 변환 실행
      convertDotsToCanvas();
    </script>
